import React, { Component } from 'react';
import {Grid} from '@material-ui/core'

class Menu extends Component {
    render() {
        return (
            <Grid item container direction="row" justify="center">
                <Grid item xs={2}>
                    <h1>Home</h1>
                </Grid>
                <Grid item xs={2}>
                    <h1>Projects</h1>
                </Grid>

                <Grid item xs={2}>
                    <h1>About Me</h1>
                </Grid>
            </Grid>


        )
    }
}

export default Menu;
